商品名の「ｈａｎａｕｔａ」には「鼻歌」と「花歌」の両方をかけ、リラックスした日常生活の楽しさ、毎日の平凡で小さな幸せを表現。ひとつひとつの花を水彩で手書きした北欧テキスタル風の図柄をもとにプリント柄を作成。洗練されたオシャレな印象の中に暖かな手作り感が漂います。またフローラル系の優しい香りで嗅覚からも柔らかな癒しの空間を表現しています。<br>見た目からも香りからも暖かでやわらかな癒しの空間を表現したプリントロール。中のプリントロールの魅力を生かしつつ優しく包み込んだ新しいタイプのパッケージを採用しました。<br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
